import React from 'react'
import img1 from './img/Group 81.png';
import img2 from './img/Group 82.png';
import img3 from './img/Group 83.png';
import img4 from './img/Group 84.png'
export default function Aksiya() {
  return (
    <div className="aksiya">
        <div className='row'>
        <div className="col-3">
            <img src="" alt="" />
        </div>
        <div className="col-3">{img2}</div>
        <div className="col-3">{img3}</div>
        <div className="col-3">{img4}</div>
    </div>
    </div>
  )
};
